clc;
clear;
ValidationData = load("ValidationData3.mat"); %[output:7f7bd0c2] %[output:69d19ec8] %[output:3e850f46] %[output:1c061948] %[output:42126973]
ValidationData = ValidationData.data;
%%
% Torques calculated via force plate forces using the jacobian, 

FPy = [];
FPz = [];
MRq = [];
MLq = [];
MRt_read = [];
MLt_read = [];
MRt_cmd = [];
MLt_cmd = [];
Fr_cmd = [];
Tr_cmd = [];
VLr = [];
VLth = [];

ts = 1000;
times = [17.5, 56;
         22.7, 70;
         15, 51.6;
         13.5, 44.5;
         14.5, 50.9];
for i = 1:5
    % Force plate
    FPy = [FPy; ValidationData{i}{2}.Values.Data(times(i, 1)*ts: times(i, 2)*ts)];
    FPz = [FPz; ValidationData{i}{3}.Values.Data(times(i, 1)*ts: times(i, 2)*ts)];
    % Motor angles
    MR_resample = resample(ValidationData{i}{11}.Values.q, ValidationData{i}{1}.Values.Time);
    MRq = [MRq; MR_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    ML_resample = resample(ValidationData{i}{12}.Values.q, ValidationData{i}{1}.Values.Time);
    MLq = [MLq; ML_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];

    VL_resample = resample(ValidationData{i}{16}.Values.Fcmd, ValidationData{i}{1}.Values.Time);
    Fr_cmd = [Fr_cmd; VL_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    VL_resample = resample(ValidationData{i}{16}.Values.Tcmd, ValidationData{i}{1}.Values.Time);
    Tr_cmd = [Tr_cmd; VL_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    VL_resample = resample(ValidationData{i}{16}.Values.r, ValidationData{i}{1}.Values.Time);
    VLr = [VLr; VL_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    VL_resample = resample(ValidationData{i}{16}.Values.th, ValidationData{i}{1}.Values.Time);
    VLth = [VLth; VL_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];

    % Motor torques (read)
    MR_resample = resample(ValidationData{i}{11}.Values.t, ValidationData{i}{1}.Values.Time);
    MRt_read = [MRt_read; MR_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    ML_resample = resample(ValidationData{i}{12}.Values.t, ValidationData{i}{1}.Values.Time);
    MLt_read = [MLt_read; ML_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];

    % Motor torques (cmd)
    MR_resample = resample(ValidationData{i}{15}.Values.tff, ValidationData{i}{1}.Values.Time);
    MRt_cmd = [MRt_cmd; MR_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];
    ML_resample = resample(ValidationData{i}{14}.Values.tff, ValidationData{i}{1}.Values.Time);
    MLt_cmd = [MLt_cmd; ML_resample.Data(times(i, 1)*ts: times(i, 2)*ts)];

end
clear MR_resample ML_resample
%%
%[text] ## Transfer force plate data into torques
% From the side of forces:
Fy_cmd = [];
Fz_cmd = [];
Fy_read = [];
Fz_read = [];
FP_tl = [];
FP_tr = [];
VL_Fz_cmd = [];
[J11, J12, J21, J22] = BalekaJacobianXY(MLq, MRq);
for i = 1:length(MLt_cmd)
    Jxy = [J11(i), J12(i); J21(i), J22(i)];
    JTxy = Jxy';

    FP_t = -JTxy*[FPy(i); FPz(i)];
    FP_tl = [FP_tl, FP_t(1)];
    FP_tr = [FP_tr, FP_t(2)];
    % 
    F_cmd = JTxy\[MLt_cmd(i); MRt_cmd(i)];
    Fy_cmd = [Fy_cmd; -F_cmd(1)];
    Fz_cmd = [Fz_cmd; -F_cmd(2)];

    F_read = JTxy\[MLt_read(i)*9*0.198; MRt_read(i)*9*0.198];
    Fy_read = [Fy_read; -F_read(1)];
    Fz_read = [Fz_read; -F_read(2)];
end
clear F_cmd F_read i J11 J12 J22 J21 times ts JTxy Jxy
%%
% forces:
plot(FPz) %[output:1d31aa34]
hold on %[output:1d31aa34]
% plot(Fz_cmd)
plot(Fz_read) %[output:1d31aa34]
Fz_read_comp = 0.6876.*Fz_read +8.0238;
plot(Fz_read_comp) %[output:1d31aa34]
legend('Force plate Fz', 'Motor read Fz', 'Compensated Motor read Fz'); %[output:1d31aa34]
title('Fz plate vs read') %[output:1d31aa34]
hold off %[output:1d31aa34]

percentErrorFz = mean(abs((Fz_read - FPz)./FPz)*100) %[output:4f640bba]

percentErrorFzComp = mean(abs((Fz_read_comp - FPz)./FPz)*100) %[output:912a37f1]


plot(FPy) %[output:61e6bdb1]
hold on %[output:61e6bdb1]
% plot(Fz_cmd)
plot(Fy_read) %[output:61e6bdb1]
Fy_read_compensated = 0.4188.*Fy_read +1.3050;
plot(Fy_read_compensated) %[output:61e6bdb1]
legend('Force plate Fy', 'Motor read Fy', 'Compensated Motor read Fy'); %[output:61e6bdb1]
title('Fy plate vs read') %[output:61e6bdb1]
hold off %[output:61e6bdb1]

percentErrorFy = mean(abs((Fy_read - FPy)./FPy)*100) %[output:5a3aad0f]

percentErrorFyComp = mean(abs((Fy_read_compensated - FPy)./FPy)*100) %[output:913715bd]
% 
% plot(FPz' - Fz_read_comp)
% title('Fz error')
% hold off
%%

% Torques
% Left motor
plot(MLt_cmd) %[output:670f0703]
hold on %[output:670f0703]
plot(FP_tl) %[output:670f0703]
legend('command', 'Force plate reading'); %[output:670f0703]
title('Left torques') %[output:670f0703]
hold off %[output:670f0703]

% Right motor
plot(MRt_cmd) %[output:70bb989d]
hold on %[output:70bb989d]
plot(FP_tr) %[output:70bb989d]
legend('command', 'Force plate'); %[output:70bb989d]
title('Right torques') %[output:70bb989d]
hold off %[output:70bb989d]

x = [FP_tl, FP_tr];
y = [MLt_cmd; MRt_cmd]';
percentError = mean(abs((y - x)./x)*100) %[output:88df7449]
%%
% forces command - do we need this?
t1 = 39000;
t2 = 49000;
linwidth = 1.5;
t = linspace(0, length(FPz(t1:t2))/1000, length(FPz(t1:t2)));
plot(t, Fz_cmd(t1: t2), LineWidth=linwidth, LineStyle='-', Color='#DDAA33') %[output:8953ce5d]
hold on %[output:8953ce5d]
plot(t, FPz(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#BB5566') %[output:8953ce5d]
plot(t, Fz_read_comp(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488' ) %[output:8953ce5d]
legend('Leg commanded force', 'Force plate measurement', 'Leg proprioception'); %[output:8953ce5d]
% title('Compensated Vertical forces')
xlabel("Time (s)") %[output:8953ce5d]
ylabel("Force (N)") %[output:8953ce5d]
hold off %[output:8953ce5d]

